import Navigation from "../components/Nav"
import MeditationTabs from "../components/MeditationTabs"

export default function Meditation() {
  return (
    <div>
      <Navigation />

      <div className="meditation-header">
        <h1>Destress</h1>
        <h3>Unwind with a short session of meditation.</h3>
      </div>

      <MeditationTabs />

      <style jsx>{`

        .meditation-header {
          margin-top: 5vh;
          position: absolute;
          left: 0;
          display: block;
          width: 95vw;
          height: 15vh;
          background: #2978F7;
          padding-left: 5vw;
          overflow: hidden;
        }

        h1 {
          font-family: "Raleway", sans-serif;
          font-size: 300%;
          margin-bottom: 0;
          margin-top: 1vh;
          color: white;
        }

        h3 {
          font-family: "Montserrat", sans-serif;
          font-size: 100%;
          font-weight: lighter;
          color: #FBF3E8;
        }

      `}</style>

    </div>
  );
}
